import React, {Fragment} from 'react';
import {Typography} from '@material-ui/core';
import 'fontsource-roboto';
import { withStyles } from '@material-ui/core/styles';

//import <link rel="stylesheet" href="https://fonts.googleapis.com/css?family=Roboto:300,400,500,700&display=swap" />

const StyledDie = withStyles({
  root: {
    margin: '5px',
    border: '5px black',
    'background-color': '#a1887f',
    color: '#efebe9',
    width: '63px',
    height: '63px',
    'border-radius': '5px',
    display: 'table-cell',
    'vertical-align': 'middle',
    'text-align': 'center'
  }
})(Die);



function Die({key, roll}){

    console.log(`printing die ${roll}`)

    return (
                <StyledDie
                    p={1} 
                    key={key}>
                        <Typography variant="h3" component="h1">{roll}</Typography>
                </StyledDie>
      )
       }    

export default Die
